import React from 'react';
import './App.css';
import task from './images/download.png';

function Header() {
  return (
    <div style={{marginTop:'10px'}}>
      <img src={task} style={{height:'50px',width:'50px'}}></img>
      <div style={{paddingLeft:'80%'}}> Task Manager </div>
      <hr/> 
    </div>
  );
}

export default Header;
